import { Box, CircularProgress } from '@mui/material';
import React, { useState, useEffect } from 'react';

function Profile() {
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [userInfo, setUserInfo] = useState(null);
    const [bookingDetails, setBookingDetails] = useState(null);
    const [services, setServices] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            const userId = localStorage.getItem("userId");
            const bookingId = localStorage.getItem("bookingId");
            try {
                // Fetch user info
                const userResponse = await fetch(`http://localhost:5000/api/register/${userId}`);
                if (!userResponse.ok) throw new Error('Failed to fetch user info');
                const userData = await userResponse.json();
                setUserInfo(userData);

                // Fetch current booking details
                const bookingResponse = await fetch(`http://localhost:5000/api/booking/${userId}`);
                if (!bookingResponse.ok) throw new Error('Failed to fetch booking details');
                const bookingData = await bookingResponse.json();
                setBookingDetails(bookingData);

                // Fetch services
                const servicesResponse = await fetch(`http://localhost:5000/api/services/${bookingId}`);
                if (!servicesResponse.ok) throw new Error('Failed to fetch services');
                const servicesData = await servicesResponse.json();
                setServices(servicesData);

                setLoading(false);
            } catch (err) {
                setError("Failed to fetch profile data");
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    if (loading) {
        return (
            <Box
                sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    height: "100vh",
                    backgroundColor: "white"
                }}
            >
                <CircularProgress />
            </Box>
        );
    }

    if (error) {
        return (
            <Box
                sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    height: "100vh",
                    backgroundColor: "white",
                    color: "red"
                }}
            >
                <p>{error}</p>
            </Box>
        );
    }

    const { name, email } = userInfo || {};
    const { roomType, guests,chec } = bookingDetails || {};

    return (
        <Box
            sx={{
                minHeight: "100vh",
                backgroundColor: "white",
                padding: "15px 30px"
            }}
        >
            {/* Header Section */}
            <Box
                sx={{
                    marginBottom: "20px",
                    backgroundColor: "red",
                    color: "white",
                    padding: "1px",
                    borderRadius: "8px"
                }}
            >
                <div style={{ textAlign: "center", marginTop: "20px" }}>
                    <h1>Your Profile</h1>
                </div>
            </Box>

            {/* User Info Section */}
            <Box
                sx={{
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "flex-start",
                    boxShadow: 3,
                    padding: "20px",
                    borderRadius: "8px",
                    backgroundColor: "white",
                    width: "100%",
                    maxWidth: "600px",
                    marginLeft: "20px",
                    marginTop: "20px",
                    height: "auto",
                    "@media (max-width:600px)": {
                        width: "90%",
                        padding: "16px"
                    }
                }}
            >
                <h2>User Information</h2>
                <p><strong>Name:</strong> {name}</p>
                <p><strong>Email:</strong> {email}</p>
            </Box>

            {/* Current Booking Section */}
            {currentBooking && (
                <Box
                    sx={{
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "flex-start",
                        boxShadow: 3,
                        padding: "20px",
                        borderRadius: "8px",
                        backgroundColor: "white",
                        width: "100%",
                        maxWidth: "600px",
                        marginLeft: "20px",
                        marginTop: "20px",
                        height: "auto",
                        "@media (max-width:600px)": {
                            width: "90%",
                            padding: "16px"
                        }
                    }}
                >
                    <h2>Current Booking</h2>
                    <p><strong>Facility:</strong> {currentBooking.facility}</p>
                    <p><strong>Date:</strong> {currentBooking.date}</p>
                    <p><strong>Time:</strong> {currentBooking.time}</p>
                    {services && (
                        <p><strong>Services:</strong> {services.join(', ')}</p>
                    )}
                </Box>
            )}

            {/* Previous Booking Section */}
            {previousBooking && (
                <Box
                    sx={{
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "flex-start",
                        boxShadow: 3,
                        padding: "20px",
                        borderRadius: "8px",
                        backgroundColor: "white",
                        width: "100%",
                        maxWidth: "600px",
                        marginLeft: "20px",
                        marginTop: "20px",
                        height: "auto",
                        "@media (max-width:600px)": {
                            width: "90%",
                            padding: "16px"
                        }
                    }}
                >

                </Box>
            )}
        </Box>
    );
}

export default Profile;
